@perssonl2 @PeterRigmover @MonikaaRubin @stinuslindgreen @FOAMmedic Det gør mig ondt for dig - det er virkelig hårdt med sygdom 😔
Derfor undrer det mig også lidt, at du et tidspunkt skrev knap så pænt om den unge pige, der stillede sig frem på TV med senfølger af Covid19 (a la ME).
De har brug for alles støtte, så der kan blive fundet en kur 🤞

