text:
@JaneHeitmann @sophieloehde Jeg blander mig lige.
Jeg er ansvsh. På et plejecenter. Vi vaccinerede med 1. Pfeizer stik i slut december. Midt januar havde vi 15 covid19 ramte borgere, ingen dødsfald.
Siden februar og frem til nu, er 17 afgået ved døden- og vi har ikke haft Corona udbrud efterfølgende.

@FaktaHoldninger Corona &amp; influenza findes om vinteren, ikke om sommeren. Der er andre luftvejssygdomme på spil. Så jo - man kan roligt antage, at der ikke er coronavirus i aug.

Problemet er, hvis man testes positiv med PCR, så siger lægerne Covid19! Men er det sandt? 👇
https://t.co/G4qD3ZOaqn

